import axios from 'axios';

const replicateFromSQL = async (db, replicationUrl) => {
    setInterval(async () => {
        let { data } = await axios.get(replicationUrl);
        await db.bulkDocs({ docs: data });
    }, 2000)
};

export default replicateFromSQL;
